import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

export default function TutorDashboard() {
  const [bookings, setBookings] = useState<any[]>([]);
  const [allSubjects, setAllSubjects] = useState<any[]>([]);
  const [mySubjectIds, setMySubjectIds] = useState<number[]>([]);
  const [loading, setLoading] = useState(true);
  
  const navigate = useNavigate();
  const userId = localStorage.getItem('userId');
  const username = localStorage.getItem('username');
  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!userId) return;

    const fetchData = async () => {
        try {
          setLoading(true);
          
          // Header ‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö‡∏™‡πà‡∏á Token
          const config = {
            headers: { Authorization: `Bearer ${token}` }
          };

          // 1. ‡∏î‡∏∂‡∏á‡∏£‡∏≤‡∏¢‡∏Å‡∏≤‡∏£‡∏à‡∏≠‡∏á
          // ‡πÉ‡∏ä‡πâ try-catch ‡πÅ‡∏¢‡∏Å ‡πÄ‡∏û‡∏∑‡πà‡∏≠‡πÑ‡∏°‡πà‡πÉ‡∏´‡πâ error ‡πÄ‡∏î‡∏µ‡∏¢‡∏ß‡∏û‡∏≤‡∏ó‡∏±‡πâ‡∏á‡∏´‡∏ô‡πâ‡∏≤‡∏û‡∏±‡∏á
          try {
            const bookingRes = await axios.get(`http://localhost:8080/api/bookings/tutor/${userId}`, config);
            setBookings(bookingRes.data);
          } catch (e) {
            console.warn("‡πÑ‡∏°‡πà‡∏™‡∏≤‡∏°‡∏≤‡∏£‡∏ñ‡∏î‡∏∂‡∏á Booking ‡πÑ‡∏î‡πâ:", e);
          }
    
          // 2. ‡∏î‡∏∂‡∏á‡∏ß‡∏¥‡∏ä‡∏≤‡∏ó‡∏±‡πâ‡∏á‡∏´‡∏°‡∏î
          try {
            const subjectRes = await axios.get('http://localhost:8080/api/subjects', config);
            setAllSubjects(subjectRes.data);
          } catch (e) {
             console.warn("‡πÑ‡∏°‡πà‡∏™‡∏≤‡∏°‡∏≤‡∏£‡∏ñ‡∏î‡∏∂‡∏á‡∏£‡∏≤‡∏¢‡∏ä‡∏∑‡πà‡∏≠‡∏ß‡∏¥‡∏ä‡∏≤‡πÑ‡∏î‡πâ:", e);
          }
    
        } catch (err) {
          console.error("Main Error:", err);
        } finally {
          setLoading(false);
        }
      };

    fetchData();
  }, [userId, token]);

  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  const toggleSubject = (subjectId: number) => {
    if (mySubjectIds.includes(subjectId)) {
        setMySubjectIds(mySubjectIds.filter(id => id !== subjectId));
    } else {
        setMySubjectIds([...mySubjectIds, subjectId]);
    }
  };

  const saveSubjects = async () => {
    try {
        await axios.post('http://localhost:8080/api/profiles/tutor/subjects', mySubjectIds, {
            headers: { Authorization: `Bearer ${token}` }
        });
        alert('‡∏ö‡∏±‡∏ô‡∏ó‡∏∂‡∏Å‡∏£‡∏≤‡∏¢‡∏ß‡∏¥‡∏ä‡∏≤‡∏™‡∏≥‡πÄ‡∏£‡πá‡∏à!');
    } catch (err) {
        alert('‡∏ö‡∏±‡∏ô‡∏ó‡∏∂‡∏Å‡πÑ‡∏°‡πà‡∏™‡∏≥‡πÄ‡∏£‡πá‡∏à');
    }
  };

  if (loading) {
      return <div className="min-h-screen flex items-center justify-center text-indigo-600 font-bold">‡∏Å‡∏≥‡∏•‡∏±‡∏á‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•...</div>;
  }

  return (
    <div className="min-h-screen bg-gray-50 font-sans">
      
      {/* Header */}
      <header className="bg-white shadow-sm sticky top-0 z-50">
        <div className="container mx-auto px-6 py-4 flex justify-between items-center">
          <div className="flex items-center gap-2">
            <span className="text-2xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-indigo-600 to-blue-500">
              üë®‚Äçüè´ Tutor Dashboard
            </span>
          </div>
          <div className="flex items-center gap-4">
             <span className="text-gray-600">‡∏™‡∏ß‡∏±‡∏™‡∏î‡∏µ, <b>{username}</b></span>
             <button onClick={handleLogout} className="text-red-500 hover:text-red-700 font-medium px-3 py-1 border border-red-100 rounded bg-red-50">
                Logout
             </button>
          </div>
        </div>
      </header>

      <div className="container mx-auto p-6 grid grid-cols-1 lg:grid-cols-3 gap-8 mt-6">
        
